t grows by gaining\nnourishment from the seed on its back.\",\"language\":{\"name\":\"en\",\"url\":\"http://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Dopo la nascita, cresce traendo nutrimento dal seme\npiantato sul suo dorso.\",\"language\":{\"name\":\"it\",\"url\":\"http://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Después de nacer, crece alimentándose de las\nsemillas de su lomo.\",\"language\":{\"name\":\"es\",\"url\":\"http://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Nach der Geburt nimmt es für eine Weile Nährstoffe\nüber den Samen auf seinem Rücken auf.\",\"language\":{\"name\":\"de\",\"url\":\"http://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Au matin de sa vie, la graine sur son dos lui fournit\nles éléments dont il a besoin pour grandir.\",\"language\":{\"name\":\"fr\",\"url\":\"http://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"태어나서부터 얼마 동안은\n등의 씨앗으로부터 영양을\n공급받아 크게 성장한다.\",\"language\":{\"name\":\"ko\",\"url\":\"http://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"うまれてから　しばらくの　あいだは\nせなかの　タネから　えいようを\nもらって　おおきく　そだつ。\",\"language\":{\"name\":\"ja\",\"url\":\"http://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"y\",\"url\":\"http://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"生まれたときから　背中に\n不思議な　タネが　植えてあって\n体と　ともに　育つという。\",\"language\":{\"name\":\"ja-kanji\",\"url\":\"http://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"A strange seed was planted on its back at birth.\nThe plant sprouts and grows with this Pokémon.\",\"language\":{\"name\":\"en\",\"url\":\"http://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Alla nascita gli è stato piantato sulla schiena un seme\nraro. La pianta sboccia e cresce con lui.\",\"language\":{\"name\":\"it\",\"url\":\"http://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Una rara semilla le fue plantada en el lomo al nacer.\nLa planta brota y crece con este Pokémon.\",\"language\":{\"name\":\"es\",\"url\":\"http://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Dieses Pokémon trägt von Geburt an einen Samen\nauf dem Rücken, der mit ihm keimt und wächst.\",\"language\":{\"name\":\"de\",\"url\":\"http://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Il a une étrange graine plantée sur son dos.\nElle grandit avec lui depuis sa naissance.\",\"language\":{\"name\":\"fr\",\"url\":\"http://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"태어났을 때부터 등에\n이상한 씨앗이 심어져 있으며\n몸과 함께 자란다고 한다.\",\"language\":{\"name\":\"ko\",\"url\":\"http://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"うまれたときから　せなかに\nふしぎな　タネが　うえてあって\nからだと　ともに　そだつという。\",\"language\":{\"name\":\"ja\",\"url\":\"http://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"x\",\"url\":\"http://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"For some time after its birth, it\ngrows by gaining nourishment from\nthe seed on its back.\",\"language\":{\"name\":\"en\",\"url\":\"http://pokeapi.co/api/v2/language/9/\"},\"version\":{\"na